__NUXT_JSONP__("/page/4", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s){return {data:[{works:{contents:[{id:"satoshisano-portfolio",createdAt:c,updatedAt:"2022-01-08T12:50:42.725Z",publishedAt:c,revisedAt:c,title:"Satoshi Sano \u002F PORTFOLIO SITE",category:[],release:d,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fd01512e290fa4dfbbd6f5d152ac48430\u002Fsatoshisano_1.jpg",height:a,width:b},overview:"イラストレーターSatoshi Sanoさんのポートフォリオサイトの制作、ポートレイトの撮影をさせていただきました。\n\n作品の雰囲気に合わせたクールなデザインに仕上がりました。\n\n更新のしやすさを配慮して、WordPressを使用したレスポンシブWebデザインで構築しました。"},{id:"satoshisano-logo",createdAt:e,updatedAt:"2022-01-08T12:50:46.609Z",publishedAt:e,revisedAt:e,title:"Satoshi Sano \u002F LOGO DESIGN",category:[],release:d,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fba27844bfd94487bb6630dc5f2e0c7da\u002Fsatohisanologo_1.jpg",height:a,width:b},overview:"イラストレーターSatoshi Sanoさんのロゴを制作させていただきました。\n\nイニシャルの「S」を使用して、未知数の可能性という意味を「X」の形に込めました。アニメ塗り・厚塗りの描き分けをヒントにフォントのウェイトを変更しメリハリを表現しました。"},{id:"networkwebshop-web",createdAt:f,updatedAt:"2022-01-08T12:50:52.633Z",publishedAt:f,revisedAt:f,title:"ネットワークウェブショップ \u002F WEB SITE",category:[],release:d,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F3896b4d819fe4f0aa85c7f61b1f2d471\u002Fnetwork_1.jpg",height:a,width:b},overview:"店舗用家具の専門店ネットワークウェブショップ様のトップページ、他2タイプの雛形の制作・スマートフォンへの対応をさせていただきました。\n\nPCでのデザインを生かしコンテンツを絞って最適化しました。",textlink1:"https:\u002F\u002Fwww.networkwebshop.com\u002F"},{id:"nicodosai-6th-web",createdAt:g,updatedAt:"2022-01-08T12:50:55.679Z",publishedAt:g,revisedAt:g,title:"第6回東方ニコ童祭 \u002F WEB SITE",category:[],release:"2014-04-30T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F863e69211d2a4e7b8c8f45bf04f2b5da\u002Fnicodosai6th_1.jpg",height:a,width:b},overview:"第6回東方ニコ童祭さんのウェブサイトを制作させていただきました。\n\nメインビジュアルは疑心暗鬼でも関わらせていただいた沼情ゲーム部のNamazuさんとSatoshiさんです。「秘封倶楽部」をテーマに世界観を意識したイラストの映えるデザインに仕上がりました。\n\nスマホ・タブレットに対応したレスポンシブWebデザインで構築しました。",textlink1:"https:\u002F\u002Fnicodosai.com\u002F6th\u002F"},{id:"yukarinorecord-logo",createdAt:l,updatedAt:m,publishedAt:l,revisedAt:m,title:"紫のレコード \u002F LOGO DESIGN",category:[],release:h,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F834755b1dc664f5385f5ae12532e8921\u002Fyukarinologo_1-800x500.jpg",height:n,width:o},overview:"大阪の音楽レーベル紫のレコードさんのロゴを制作させていただきました。\n\n用途によってロゴマーク・ロゴタイプを使い分けて利用されます。谷崎裕映さんが新しく設立した音楽レーベルです。",textlink1:"https:\u002F\u002Ftwitter.com\u002FYUKARInoTWEET"},{id:"unknown-feelings-musiksoda",createdAt:p,updatedAt:q,publishedAt:p,revisedAt:q,title:"unknown feelings \u002F musik soda",category:[],release:h,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F0c8744be64f4424fa08c918ee9262999\u002Funknown_b1-800x500.jpg",height:n,width:o},overview:"大阪の歌ものエレクトロニカユニットmusik sodaさんの「SIX YEARS」収録曲unknown feelingsの映像を制作させていただきました。\n\nミニマルに音に合わせてメッセージを伝えるイメージを表現しました。",textlink1:"http:\u002F\u002Fmusiksoda.com\u002F"},{id:"awanohana",createdAt:r,updatedAt:"2022-01-09T00:35:16.209Z",publishedAt:r,revisedAt:"2022-01-09T00:25:02.928Z",title:"awanohana \u002F iPhone5 Case",category:[],release:h,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F6da2e7c236164ebe8cb5e77f944de512\u002Fiphone5case_b12.jpg",height:372,width:600},overview:"不二印刷株式会社様のiPhone5 Caseのデザイン例を制作させていただきました。オリジナルテキスタイルawanohanaを使っていただいてます。"},{id:"rwd-gallery",createdAt:i,updatedAt:"2022-01-09T00:35:21.989Z",publishedAt:i,revisedAt:i,title:"RWD \u002F GALLERY SITE",category:[],release:s,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F146e68c7a0194843afdb9aceb57376f4\u002Frwd_1-1.jpg",height:a,width:b},overview:"空いた時間に片手間で見れるデザインの刺激になるレスポンシブWebデザインのサイトを紹介したRWDのギャラリーサイトを制作しました。\n\n空いた時間に片手で最近のデザインが見れるという所に重点を置いて、機能はシンプルに新着順に一列のタイムラインにした1カラムのレイアウトです。サムネイルを見るだけでスマホ・タブレット・PCのレイアウトが把握できるよう工夫をしました。\n\n更新のしやすさを配慮して、WordPressを使用したレスポンシブWebデザインで構築しました。"},{id:"rwd-logo",createdAt:j,updatedAt:"2022-01-09T00:35:24.847Z",publishedAt:j,revisedAt:j,title:"RWD \u002F LOGO DESIGN",category:[],release:s,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F9412d9c14342400088bcddee6b9dbcd6\u002Frwdlogo_1.jpg",height:a,width:b},overview:"空いた時間に片手間で見れるデザインの刺激になるレスポンシブWebデザインのサイトを紹介したギャラリーサイト「RWD」のロゴを制作しました。"},{id:"sensation-web",createdAt:k,updatedAt:"2022-01-09T00:35:29.055Z",publishedAt:k,revisedAt:k,title:"株式会社Sensation \u002F WEB SITE",category:[],release:"2013-12-31T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F7c5c96af810f402cb9f1fd1717cbda67\u002Fsensation_1.jpg",height:a,width:b},overview:"芸能プロダクション株式会社Sensation様のウェブサイトを制作させていただきました。\n\n新人タレント・アーティストの募集などを考慮して、やわらかい印象でありながらも品のある誠実な印象のデザインに仕上がりました。\n\nスマホ・タブレットに対応したレスポンシブWebデザインで構築しました。"}],totalCount:66,offset:30,limit:10},page:"4",pager:[0,1,2,3,4,5,6]}],fetch:{},mutations:void 0}}(670,1080,"2022-01-08T12:41:39.185Z","2014-06-30T15:00:00.000Z","2022-01-08T12:42:49.876Z","2022-01-08T12:44:37.161Z","2022-01-08T12:46:35.655Z","2014-02-28T15:00:00.000Z","2022-01-08T12:56:36.437Z","2022-01-09T00:06:15.563Z","2022-01-09T00:07:43.175Z","2022-01-08T12:47:58.073Z","2022-01-08T13:05:58.974Z",500,800,"2022-01-08T12:49:40.503Z","2022-01-09T00:46:08.750Z","2022-01-08T12:55:04.868Z","2014-01-31T15:00:00.000Z")));